import React, { useState, useEffect } from 'react';
import { Activity, Clock, CheckCircle, AlertCircle, Play, Pause } from 'lucide-react';

const LiveExecutionMonitor = ({ taskId, isVisible, onClose }) => {
  const [executionLogs, setExecutionLogs] = useState([]);
  const [currentAgent, setCurrentAgent] = useState(null);
  const [currentStep, setCurrentStep] = useState(null);
  const [progress, setProgress] = useState(0);
  const [isAutoScroll, setIsAutoScroll] = useState(true);

  useEffect(() => {
    if (!isVisible || !taskId) return;

    // Fetch initial logs
    fetchExecutionLogs();

    // Set up WebSocket listener for real-time updates
    const handleExecutionLog = (data) => {
      if (data.task_id === taskId) {
        setExecutionLogs(prev => [...prev, data.log]);
        setCurrentAgent(data.current_agent);
        setCurrentStep(data.current_step);
        setProgress(data.task_progress || 0);

        // Auto-scroll to bottom if enabled
        if (isAutoScroll) {
          setTimeout(() => {
            const logContainer = document.getElementById('execution-logs');
            if (logContainer) {
              logContainer.scrollTop = logContainer.scrollHeight;
            }
          }, 100);
        }
      }
    };

    // Add event listener (assuming WebSocket service is available)
    if (window.wsService) {
      window.wsService.on('execution_log', handleExecutionLog);
    }

    return () => {
      if (window.wsService) {
        window.wsService.off('execution_log', handleExecutionLog);
      }
    };
  }, [taskId, isVisible, isAutoScroll]);

  const fetchExecutionLogs = async () => {
    try {
      const response = await fetch(`/api/tasks/${taskId}/logs`);
      if (response.ok) {
        const data = await response.json();
        setExecutionLogs(data.logs || []);
      }
    } catch (error) {
      console.error('Error fetching execution logs:', error);
    }
  };

  const getStatusIcon = (status) => {
    switch (status) {
      case 'completed':
        return <CheckCircle className="w-4 h-4 text-success-500" />;
      case 'running':
        return <Activity className="w-4 h-4 text-warning-500 animate-pulse" />;
      case 'error':
        return <AlertCircle className="w-4 h-4 text-error-500" />;
      default:
        return <Clock className="w-4 h-4 text-gray-400" />;
    }
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'completed':
        return 'text-success-600 bg-success-50';
      case 'running':
        return 'text-warning-600 bg-warning-50';
      case 'error':
        return 'text-error-600 bg-error-50';
      default:
        return 'text-gray-600 bg-gray-50';
    }
  };

  const formatTimestamp = (timestamp) => {
    return new Date(timestamp).toLocaleTimeString();
  };

  const getAgentColor = (agent) => {
    const colors = {
      'orchestration_coordinator': 'bg-blue-100 text-blue-800',
      'task_allocation_manager': 'bg-green-100 text-green-800',
      'research_intelligence_agent': 'bg-purple-100 text-purple-800',
      'data_processing_specialist': 'bg-orange-100 text-orange-800',
      'execution_monitor': 'bg-red-100 text-red-800',
      'quality_assurance_specialist': 'bg-indigo-100 text-indigo-800',
      'system': 'bg-gray-100 text-gray-800'
    };
    return colors[agent] || 'bg-gray-100 text-gray-800';
  };

  if (!isVisible) return null;

  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center p-4 z-50">
      <div className="bg-white rounded-lg max-w-6xl w-full max-h-[90vh] overflow-hidden flex flex-col">
        {/* Header */}
        <div className="flex items-center justify-between p-6 border-b border-gray-200">
          <div className="flex items-center space-x-3">
            <Activity className="w-6 h-6 text-primary-600" />
            <div>
              <h2 className="text-xl font-semibold text-gray-900">Live Execution Monitor</h2>
              <p className="text-sm text-gray-500">Task ID: {taskId?.slice(0, 8)}...</p>
            </div>
          </div>

          <div className="flex items-center space-x-4">
            {/* Progress Bar */}
            <div className="flex items-center space-x-2">
              <span className="text-sm text-gray-600">Progress:</span>
              <div className="w-32 bg-gray-200 rounded-full h-2">
                <div 
                  className="bg-primary-600 h-2 rounded-full transition-all duration-300"
                  style={{ width: `${progress}%` }}
                ></div>
              </div>
              <span className="text-sm font-medium text-gray-900">{progress}%</span>
            </div>

            <button
              onClick={onClose}
              className="p-2 text-gray-400 hover:text-gray-600 transition-colors"
            >
              Ã—
            </button>
          </div>
        </div>

        {/* Current Status */}
        {currentAgent && currentStep && (
          <div className="p-4 bg-primary-50 border-b border-primary-200">
            <div className="flex items-center space-x-3">
              <Activity className="w-5 h-5 text-primary-600 animate-pulse" />
              <div>
                <span className="text-sm font-medium text-primary-900">Current Activity:</span>
                <span className={`ml-2 px-2 py-1 rounded-full text-xs font-medium ${getAgentColor(currentAgent)}`}>
                  {currentAgent.replace(/_/g, ' ').replace(/\b\w/g, l => l.toUpperCase())}
                </span>
                <span className="ml-2 text-sm text-primary-700">{currentStep.replace(/_/g, ' ')}</span>
              </div>
            </div>
          </div>
        )}

        {/* Controls */}
        <div className="p-4 border-b border-gray-200 bg-gray-50">
          <div className="flex items-center justify-between">
            <div className="flex items-center space-x-4">
              <span className="text-sm font-medium text-gray-700">
                Execution Logs ({executionLogs.length})
              </span>
            </div>

            <div className="flex items-center space-x-2">
              <button
                onClick={() => setIsAutoScroll(!isAutoScroll)}
                className={`inline-flex items-center px-3 py-1 rounded-md text-xs font-medium transition-colors ${
                  isAutoScroll 
                    ? 'bg-primary-100 text-primary-700' 
                    : 'bg-gray-100 text-gray-700'
                }`}
              >
                {isAutoScroll ? <Pause className="w-3 h-3 mr-1" /> : <Play className="w-3 h-3 mr-1" />}
                Auto-scroll
              </button>

              <button
                onClick={fetchExecutionLogs}
                className="inline-flex items-center px-3 py-1 rounded-md text-xs font-medium bg-gray-100 text-gray-700 hover:bg-gray-200 transition-colors"
              >
                Refresh
              </button>
            </div>
          </div>
        </div>

        {/* Execution Logs */}
        <div 
          id="execution-logs"
          className="flex-1 overflow-y-auto p-4 space-y-3 bg-gray-50"
        >
          {executionLogs.length === 0 ? (
            <div className="text-center py-8">
              <Activity className="w-12 h-12 text-gray-400 mx-auto mb-4" />
              <p className="text-gray-500">No execution logs yet...</p>
            </div>
          ) : (
            executionLogs.map((log, index) => (
              <div key={index} className="bg-white rounded-lg border border-gray-200 p-4">
                <div className="flex items-start space-x-3">
                  <div className="flex-shrink-0 mt-1">
                    {getStatusIcon(log.status)}
                  </div>

                  <div className="flex-1 min-w-0">
                    <div className="flex items-center space-x-2 mb-2">
                      <span className={`px-2 py-1 rounded-full text-xs font-medium ${getAgentColor(log.agent)}`}>
                        {log.agent.replace(/_/g, ' ').replace(/\b\w/g, l => l.toUpperCase())}
                      </span>

                      <span className={`px-2 py-1 rounded-full text-xs font-medium ${getStatusColor(log.status)}`}>
                        {log.action.replace(/_/g, ' ').replace(/\b\w/g, l => l.toUpperCase())}
                      </span>

                      <span className="text-xs text-gray-500">
                        {formatTimestamp(log.timestamp)}
                      </span>
                    </div>

                    <p className="text-sm text-gray-700 leading-relaxed">
                      {log.message}
                    </p>
                  </div>
                </div>
              </div>
            ))
          )}
        </div>
      </div>
    </div>
  );
